import React,{ useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
// import { Container } from '@material-ui/core';
import Grid from '@material-ui/core/Grid'
import { pupils } from "./pupils"
import PupilCard from "./Components/PupilCard";
import Heading from "./Components/Heading"
import { async } from 'q';
// import Button from '@material-ui/core/Button'



const App = () => {


const [data, setData] = useState();
useEffect(() => {
    async function fetchData(){await fetch(`https://sheets.googleapis.com/v4/spreadsheets/17wRpb7VONlsXOPjsQ4tmihKO6fbR-JQ-yTxmigbTmso/values/B1:G5`,
    {
      headers: {
        "Content-Type": "application/json",
        Authorization: "Bearer ya29.Il-PBzHquvwmWPCwminvQl8C-LFeRKdWOuCWS2Kchc1bsVQlwD_b3O-epOctge7KX3sQLYNL4zNeFMNs1jx-N4nbJfZTmbXm7GOXTdnlJ3tnJf8u0D2uXunMhk1sZyJqig" 
    }
    });
    const result = fetchData();
    setData(result);
    }})


 return (
<>
    <Heading/>
    <Grid container justify="center" alignItems="center" spacing={2}>
    {pupils.map(pupil => {
        return (<Grid item>    
        <PupilCard 
        key={pupil.id}
        firstname={pupil.firstname} 
        surname={pupil.surname}
        photo={pupil.photo}
        behaviourPoints={pupil.behaviourPoints}
        assessmentOne={pupil.assessmentOne}
        assessmentTwo={pupil.assessmentTwo}
        assessmentThree={pupil.assessmentThree} 
        />
    </Grid>)})}

    </Grid>
 </>
 )}

ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
